import appReducer1 from "./reducer1";

const initialState2 = [];
const appReducer2 = (state = initialState2, action) => {
	switch (action.type) {
		case "del":
			return state.filter(each => each.id !== action.id);
		default:
			return state;
	}
	//reducer
};

export default appReducer2;
